import React from 'react';
import { Link } from 'react-router-dom';
import { logoutUser } from './actions/session';

class NavigationBar extends React.Component{

    constructor(props){
        super(props)
    }

    handleLogOut = () => {
        if(window.confirm("Are you sure you want to log out?")){
            logoutUser()
            this.props.history.push('/login')
            this.props.app.state.currentUser = null
            this.props.app.state.admin = "false"
        }
        console.log(this.props)
    }

    render(){
        const { app, history } = this.props

        return(
            <div >
                <h2>MAXimizing to Better Tastes!</h2>
                <Link to={'/Main'}>
                    <button className="topButtons">Main Page</button>
                </Link>
                { app.state.admin === "false" ? null : <span>
                        <Link to={'/AllUsers'}>
                            <button className="topButtons">Modify Users</button>
                        </Link>
                        <Link to={'/Setting'}>
                            <button className="topButtons">Update List Categories</button>
                        </Link> 
                        </span>}

                <Link to={'/Search'}>
                    <button className="topButtons">Search for Similar Lists</button>
                </Link>
                <Link to={'/Friends'}>
                    <button className="topButtons">Friends</button>
                </Link>
                <Link to={'/Profile'}>
                    <button className="topButtons">Profile</button>
                </Link>
                <button type = "button" onClick = {this.handleLogOut}> Log out</button>
                <hr/>
            </div>
        )
    }
}

export default NavigationBar;
